import React, { useEffect, useState } from 'react';
import { View, Text } from 'react-native';
import { RectButton, ScrollView, TextInput } from 'react-native-gesture-handler';
import { FontAwesome } from '@expo/vector-icons';

import styles from './estilo';

import { HeaderRequisicao, DadosUsuario } from '../../AuthContext';

function tConfiguracao({ }) {
  const [usuarios, setUsuarios] = useState([]);

  async function MostrarUsuario() {
    const userData = await DadosUsuario();
    const headers = await HeaderRequisicao();
    const url = `https://localhost:44396/api/usuarios?usuario_id=${userData.ID}`;
    
    fetch(url, {
      method: 'GET',
      headers
    })
      .then((response) => response.json())
      .then((json) => {
        setUsuarios(json);
      })
      .catch((error) => {
        console.log(error);
        alert('Erro ao inserir informações');
      });
  }

  useEffect(() => {
    MostrarUsuario();
  }, []);

  return (

    <ScrollView>
        <View style={styles.container}>
            <Text style={styles.title}>Olá, Usuário!</Text>
            <View style={styles.view}>
                <View style={styles.editor}>
                    <FontAwesome name="pencil-square-o" size={24} color="black"/>
                </View>
                <Text style={styles.text}>Nome</Text>
                <TextInput style={styles.input}></TextInput>

                <TextInput />

                <Text style={styles.text}>Sobrenome</Text>
                <TextInput
                    style={styles.input}
                />

                <TextInput />

                <Text style={styles.text}>Email</Text>
                <TextInput
                    style={styles.input}
                />

                <TextInput />

                <Text style={styles.text}>Cidade</Text>
                <TextInput
                    style={styles.input}
                />

                <TextInput />

                <Text style={styles.text}>Celular</Text>
                <TextInput
                    style={styles.input}
                />

                <TextInput />

                <Text style={styles.text}>Preço</Text>
                <TextInput
                    style={styles.input}
                />

                <TextInput />

                <Text style={styles.text}>Descrição</Text>
                <TextInput
                    style={styles.inputDesc}
                    multiline
                />

                <TextInput />
                <TextInput />
                <TextInput />
                <TextInput />

                <RectButton style={styles.button}>
                    <Text style={styles.buttonText}>Salvar Alterações</Text>
                </RectButton>

                <TextInput />
                <TextInput />
                <TextInput />
                <TextInput />
            </View>
        </View >
    </ScrollView>

);
}

export default tConfiguracao;
